import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import backgroundImage from '../slike/slika1.jpg';

const ONama = () => {
  const divStyle = {
    backgroundImage: `url(${backgroundImage})`,
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    backgroundPosition: 'center',
    minHeight: '100vh',
    color: 'white',
    padding: '20px',
  };


  return (
    <div className="container mt-5" style={divStyle}>
      <h1 className="display-4 mb-4">O nama</h1>
      <div className="card bg-transparent">
        <div className="card-body">
          <p className="card-text">Dobrodošli na FitZone!</p>
          <p className="card-text">Mi smo strastveni tim entuzijasta koji vjeruje u zdrav način života i važnost aktivnog fizičkog treninga.</p>
          <p className="card-text">Naša misija je inspirirati ljude da postignu svoje fitness ciljeve, bez obzira na njihove početne točke.</p>
          <p className="card-text">U FitZone-u, fokusiramo se na pružanje podrške i resursa kako bi naši članovi postigli svoj vrhunac zdravlja i kondicije.</p>
          <p className="card-text">Nudimo raznolike programe treninga prilagođene svim nivoima kondicije, od početnika do naprednih sportaša.</p>
          <p className="card-text">Naš tim sastoji se od stručnjaka iz područja fitnesa, nutricionista i motivacionih trenera koji su ovdje da vam pomognu da postignete svoje ciljeve.</p>
          <p className="card-text">Bilo da želite izgubiti težinu, dobiti na snazi, poboljšati kondiciju ili jednostavno održavati zdrav način života, FitZone je mjesto gdje ćete pronaći podršku i motivaciju za postizanje svojih ciljeva.</p>
          <p className="card-text">Pratite nas i budite dio naše zajednice na društvenim mrežama kako biste bili u toku s našim događajima, savjetima i inspiracijom za zdraviji način života.</p>
          <p className="card-text">Hvala vam što ste odabrali FitZone za svoj fitness put. Radujemo se što ćemo biti vaši partneri na putu ka zdravlju i dobrobiti!</p>
        </div>
      </div>
    </div>
  );
};

export default ONama;
